    <form onSubmit={addUserHandler}>
    <label htmlFor="">Username</label>
<input type="text" name="" id="username" />
<label htmlFor="">Age (Years)</label>
<input type="text" name="" id="age" />
<button type='submit'>Add User</button>
    </form>
    );
};

